            "content": "\\tclass Solution {\\n\\tpublic:\\n\\t\\tvector<int> twoSum(vector<int>& nums, int target) {\\n\\n\\t\\t\\tunordered_map<int,int> mmap ; \\n\\n\\n\\t\\t\\tvector<int> res ;      \\n\\n\\t\\t\\tfor(int i = 0 ; i < nums.size() ; i++)\\n\\t\\t\\t{\\n\\t\\t\\t\\tif(mmap.find(target - nums[i]) != mmap.end())\\n\\t\\t\\t\\t{\\n\\t\\t\\t\\t\\tres.push_back(mmap.find(target - nums[i])->second) ; \\n\\t\\t\\t\\t\\tres.push_back(i) ; \\n\\t\\t\\t\\t\\treturn res ; \\n\\t\\t\\t\\t}\\n\\t\\t\\t\\telse\\n\\t\\t\\t\\t{\\n\\t\\t\\t\\t\\tmmap.insert(make_pair(nums[i] , i)) ; \\n\\t\\t\\t\\t}\\n\\t\\t\\t}\\n\\n\\n\\n\\t\\t\\treturn res ; \\n\\n\\t\\t}\\n\\t};",
